import { Socket } from "socket.io-client";
import { BrewControllerState } from "../../../../server/lib/models/controllerModels";
import BrewPanel from "./BrewPanel";

interface BreweryPanelProps {
  brewControllerState: BrewControllerState[];
}

export function BreweryPanels(props: BreweryPanelProps) {
  const { brewControllerState } = props;

  return (
    <div>
      {brewControllerState.map((controller) => {
        return <BrewPanel key={controller.name} controller={controller} />;
      })}
    </div>
  );
}
